import './App.css';
import Home from './Pages/Home/Home.js'
import {BrowserRouter, Routes, Route} from "react-router-dom";
import Login from "./Pages/Login/Login.js";
import RegisterUser from "./Pages/Login/RegisterUser.js";
import ForgotPassword from "./Pages/Login/ForgotPassword.js";
import MovieDetailsPage from "./Pages/MovieDetailsPage/MovieDetailsPage.js";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Login/>}></Route>
        <Route path="/homeMovies" element={<Home/>}></Route>
        <Route path="/RegisterUser" element={<RegisterUser/>}></Route>
        <Route path="/ForgotPassword" element={<ForgotPassword/>}></Route>
        <Route path='/homeMovies/:id' element={<MovieDetailsPage/>}></Route>
      </Routes>  
    </BrowserRouter>

  );
}

export default App;
